INSERT INTO `v1_dd64ce831b92fb17bfc9cc0d1bbf0c342bc323412a013455a8ce480d500d713b` VALUES (26214063, 26214, 11, 103811, "わぁ、絵本に出てきそうな\n大きなケーキですね。\nもしかして、\n私の誕生日のために……？", 10, 1, 1, 0, 0, 0.5);
INSERT INTO `v1_dd64ce831b92fb17bfc9cc0d1bbf0c342bc323412a013455a8ce480d500d713b` VALUES (26214064, 26214, 91, 0, "", "", "", "", "", "", "");
