INSERT INTO `v1_dd64ce831b92fb17bfc9cc0d1bbf0c342bc323412a013455a8ce480d500d713b` VALUES (26214068, 26214, 11, 103311, "そうだべ！\n誕生日おめでとう、シオシオ！\nこのケーキはシオシオの好きな\n牧場特製の食材も使って作ったべや！", 10, 1, 1, 0, 0, 0.5);
