INSERT INTO `v1_dd64ce831b92fb17bfc9cc0d1bbf0c342bc323412a013455a8ce480d500d713b` VALUES (26214073, 26214, 11, 105211, "私もだけど、彼とリンちゃんも準備を\nがんばったのよ♪\nふふっ、シオリちゃんのために～って\n張り切ってたのよね？", 10, 1, 1, 0, 0, 0.5);
