INSERT INTO `v1_dd64ce831b92fb17bfc9cc0d1bbf0c342bc323412a013455a8ce480d500d713b` VALUES (38614074, 38614, 11, 105611, "ああ、かまわないけど……\n急にあらたまって、どうしたんだい？\nずいぶん真剣な様子じゃないか。", 10, 1, 1, 0, 0, 0.5);
